import React from "react";
import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <div className="m-6 mt-20 bg-slate-700 w-fit content-center flex p-3 rounded-full pt-5 pb-5 fixed ">
      <ul className="text-2xl flex flex-col gap-10 cursor-pointer content-center justify-center ">
        <Link to={"/"}>
          <li className="fa-solid fa-house"></li>
        </Link>
        <Link to={"/education"}>
          <li className="fa-solid fa-book"></li>
        </Link>
        <Link to={"/projects"}>
          <li className="fa-solid fa-laptop-file"></li>
        </Link>
        <Link to={"/contact"}>
          <li className="fa-solid fa-headset"></li>
        </Link>
        <Link to={"/progress"}>
          <li className="fa-solid fa-bars-progress"></li>
        </Link>
      </ul>
    </div>
  );
};

export default SideBar;
